description:
InstallShortcutsThenQuit command line takes a bit long time to create shortcuts. Because there is a 10s timer when download icons. Change timer from 10s to 2s to make shortcut creating faster.

change const UINT ICON_DOWNLOAD_CHECK_TIMER_ELAPSE_MS = 10000u;
to const UINT ICON_DOWNLOAD_CHECK_TIMER_ELAPSE_MS = 2000u;

